import { Container, Row, Col, Button, Card } from "react-bootstrap";
function Portfolio() {
  return (
    <div>
      <br />

      <Container fluid>
        <br />
        <br />
        <center>
          <Row style={{ width: "100%", padding: "0px" }}>
            <Col
              xs={12}
              md={3}
              style={{
                backgroundImage: 'url("./img/9.png")',
                height: "50vh",
              }}
            ></Col>
            <Col
              xs={12}
              md={3}
              style={{
                height: "40vh",
              }}
            >
              <Card
                style={{
                  width: "100%",
                  height: "100%",
                  border: "0px",
                }}
              >
                <Card.Img variant="top" src="./assets/img/9.png" />
                <Card.Body></Card.Body>
              </Card>
            </Col>
            <Col
              xs={12}
              md={3}
              style={{
                height: "40vh",
              }}
            >
              <Card
                style={{
                  width: "100%",
                  height: "100%",
                  border: "0px",
                }}
              >
                <Card.Img variant="top" src="./assets/img/9.png" />
                <Card.Body></Card.Body>
              </Card>
            </Col>
            <Col
              xs={12}
              md={3}
              style={{
                height: "40vh",
              }}
            >
              <Card
                style={{
                  width: "100%",
                  height: "100%",
                  border: "0px",
                }}
              >
                <Card.Img variant="top" src="./assets/img/9.png" />
                <Card.Body></Card.Body>
              </Card>
            </Col>
          </Row>
        </center>
      </Container>
      <br />
      <br />
      <br />
      <br />
    </div>
  );
}
export default Portfolio;
